    false,nt"url": null,nt"notes": "The color Alaska shaded relief data were
    derived from National Elevation Dataset (NED) data, and show the terrain of Alaska
    at a resolution of 200 meters. The NED is a raster product assembled by the U.S.
    Geological Survey, designed to provide national elevation data in a seamless form
    with a consistent datum, elevation unit, and projection. Data corrections made in
    the NED assembly process minimize artifacts, permit edge matching, and fill sliver
    areas of missing data. The National Atlas also includes a Lambert Azimuthal Equal
    Area projection shaded relief file; this file is the same data in an Albers projection.",nt"license_title":
